wow wow wow…i don’t even know where to begin. i will start by saying i don’t think any of you realize how much you and this program meant to me this year. it was definitely a different type of year for me. not dancing with a team anymore and losing most of the people i called my closest friends was such a switch. but you guys became my people. you guys have been the most supportive and loving friends i could have ever asked for. you guys changed my life in a way you don’t even know. i love you all so so much and i’m so glad i was able to dance with all of you<3

@ashley_gonzo @wbezz thank you guys beyond words,i’ve dreamed of being apart of this company for yearsssss and it was everything and more. 

next stop- vegas baby🤩

