so sad to say i just ended one of the best years of my life…winning senior mva has been a dream come true and i am so happy to have passed it on to this killer @masonwalkerrrr ! no words can explain how happy and excited i am for you! 
@ashley_gonzo @wbezz i want to thank both of you from the bottom of my heart for everything you guys have done for me, none of it would be possible without you guys and i thank you for the best year<3

my plus fam, i love you guys more then life and thank you all for making this year one i won’t ever forget. i’m gonna miss dancing with all of u soooo much!

@velocitydanceconvention @coryjonesoc @evemason i cant thank you guys enough for creating such a safe and loving environment for us, thank you for all you guys have done!
